import React, { Component, useEffect, useState } from 'react';
import { MDBTable, MDBTableHead, MDBTableBody, MDBBtn } from 'mdb-react-ui-kit';
import { ethers } from "ethers";
import abi from "./abi.json";
import Navbar from './Navbar.js';

export default class Table extends Component {

  constructor(props) {

    super(props);

    this.state = {

    };
  }



  async connect() {
    if (typeof window.ethereum == 'undefined') {
      alert('Please install Metamask to continue');
    }
    let provider = new ethers.providers.Web3Provider(web3.currentProvider);

    const accounts = await provider.send("eth_requestAccounts", []);


    let contract = new ethers.Contract('0x1eC7b4E7AD7BEa7371e849F4c31f267b95380055', abi, provider);
    let propNumbers = await contract.viewProposals();
    let numbers = await propNumbers[1]._hex;
    let tableNumber = parseInt(numbers, 16);

    for (let i = tableNumber; i >= 1; i--){
      let arr = [];
      let proposalOne = await contract.proposalToId(i);
      let description = await proposalOne.description;
      let name = await proposalOne.name;
      let proposedBy = await proposalOne.proposedBy.toString();
      let item = await proposalOne.deadline;
      let myDate = await new Date(item * 1000);
      let finalDate = await myDate.toLocaleString();
      let deadline = await finalDate + ' UTC';
      let votesUp = await proposalOne.votesUp.toString();
      let votesDown = await proposalOne.votesDown.toString();
      let passed = await proposalOne.passed.toString();
      arr.push(i.toString(), name, description, proposedBy, deadline, votesUp, votesDown, passed);

      if(i == 3){
        this.setState({ propThree: arr });
      } else if(i == 2){
        this.setState({ propTwo: arr });
    } else {
      this.setState({ propOne: arr });
    }
  }

    this.setState({ selectedAddress: accounts[0] });





  }

  renderMetamask() {
    if (!this.state.selectedAddress) {
      return (
        <>
        <Navbar
      title="DAO Proposals"
      message="Please connect your wallet to view recent DAO proposals" />
        <MDBBtn onClick={() => this.connect()} outline rounded >
        Show Recent Proposals
      </MDBBtn>
      </>
      )
    } 
      else if (this.state.selectedAddress.toString().length > 3){
      console.log(this.state.selectedAddress)
      return (
        <>
        <Navbar
      title="DAO Proposals"
      message="Please connect your wallet to view recent DAO proposals" />
        <MDBTable striped>
      <MDBTableHead>
        <tr>
          <th scope='col'>Proposal ID</th>
          <th scope='col'>Name</th>
          <th scope='col'>Description</th>
          <th scope='col'>Proposed By</th>
          <th scope='col'>Deadline</th>
          <th scope='col'>Votes Up</th>
          <th scope='col'>Votes Down</th>
          <th scope='col'>Passed?</th>
        </tr>
      </MDBTableHead>
      <MDBTableBody>
        <tr>
          <th scope='row'>{this.state.propThree[0]}</th>
          <td> {this.state.propThree[1]}</td>
          <td>{this.state.propThree[2]}</td>
          <td>{this.state.propThree[3]}</td>
          <td>{this.state.propThree[4]}</td>
          <td>{this.state.propThree[5]}</td>
          <td>{this.state.propThree[6]}</td>
          <td>{this.state.propThree[7]}</td>
        </tr>
        <tr>
          <th scope='row'>2</th>
          <td> {this.state.propTwo[1]}</td>
          <td>{this.state.propTwo[2]}</td>
          <td>{this.state.propTwo[3]}</td>
          <td>{this.state.propTwo[4]}</td>
          <td>{this.state.propTwo[5]}</td>
          <td>{this.state.propTwo[6]}</td>
          <td>{this.state.propTwo[7]}</td>
        </tr>
        <tr>
          <th scope='row'>3</th>
          <td>{this.state.propOne[1]}</td>
          <td>{this.state.propOne[2]}</td>
          <td>{this.state.propOne[3]}</td>
          <td>{this.state.propOne[4]}</td>
          <td>{this.state.propOne[5]}</td>
          <td>{this.state.propOne[6]}</td>
          <td>{this.state.propOne[7]}</td>
        </tr>
      </MDBTableBody>
    </MDBTable>
    </>
      );
    }
  }

  render() {
    return(
      <div>
        {this.renderMetamask()}
      </div>
    )
  }
}
